import styled from 'styled-components';


export const Title = styled.h1`
  color: #32b8bf;
  `;

export const Div = styled.div`
  width: 100%;
  margin-left: auto;
  margin-right: auto;
  margin-top: 1.5rem;
  position:absolute;
  text-align:center;
  `;

export const Img = styled.img`
  width: 50%;
`;
